import './ToDoList.css';
import React from 'react';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import ToDoItem from '../ToDoItem';

const ToDoList = (props) => {

    return (
        <div className="container">
            <Typography className="text-new-task">To Do List</Typography>
            <TextField className="add-new" id="outlined-basic" placeholder="Search..." variant="outlined"/>
            <div>
                <ToDoItem/>
            </div>
            <div className="box-bulk">
                <Typography>Bulk Action</Typography>

                <div className="btn-bulk">
                    <Button variant="outlined" id="btn-done" >Done</Button>
                    <Button variant="outlined" id="btn-remove-bulk">Remove</Button>

                </div>
            </div>


        </div>
    );
};

export default ToDoList;
